package com.molcom.nms.companyrep.dto;

import com.fasterxml.jackson.annotation.JsonIgnoreProperties;
import io.swagger.annotations.ApiModelProperty;
import lombok.Data;
import org.springframework.lang.Nullable;


@Data
@JsonIgnoreProperties(ignoreUnknown = true)
public class CompRepModel {
    @Nullable
    private String companyRepId;

    @ApiModelProperty(example = "Wilson")
    private String firstname;

    @ApiModelProperty(example = "Stone")
    private String lastname;

    @ApiModelProperty(example = "Molcom")
    private String userId;

    @ApiModelProperty(example = "123.70.04.84")
    private String ipAddress;

    @ApiModelProperty(example = "Miss")
    private String title;

    @ApiModelProperty(example = "Stone@gmail.con")
    private String email;

    @ApiModelProperty(example = "09037927394")
    private String phoneNumber;

    @ApiModelProperty(example = "Engineer")
    private String designation;

    @ApiModelProperty(example = "data:image/png;base64,")
    private String passport;

    @ApiModelProperty(example = "data:image/png;base64,")
    private String signature;

    @ApiModelProperty(example = "2022-10-02 08:39:19")
    private String createdDate;

    @ApiModelProperty(example = "2022-10-02 08:39:19")
    private String modifiedDate;

    @ApiModelProperty(example = "Molcom")
    private String organisation;

    @ApiModelProperty(example = "System")
    private String updatedBy;

    @Nullable
    private String applicationId;

    @Nullable
    private String selectedCompanyRepId;
}
